import { ColumnNumber, FirstColumn } from "./Table.style";

export const Table = () => {
  return (
    <>
      <table>
        <thead>
          <tr style={{}}>

              <th><FirstColumn> hh </FirstColumn></th>

            <ColumnNumber style={{ background: "#fafafa" }}>
              <th>№ договора</th>
            </ColumnNumber>
            <th>Дата создания</th>
            <th>Дата окончания</th>
            <th>Комментарии</th>
            <th>Статус</th>
            <th>Действие</th>
          </tr>
        </thead>
      </table>
    </>
  );
};
